webpackJsonp([0x8f0a2acbdc83],{3417:function(n,i){n.exports={data:{markdownRemark:{html:'<p>確か最後の白ブレッツァだったっけ？ 自分にとって初PC/AT互換機であり、初 Pentium 機でもあり初 Windows 機であった。 (と言うより今まで PC-98 信者だった) 性能は <a href="/pc-9821">先代</a>に比べると、実に 12 倍近く。  今までのソフトの互換性は最初から諦めてたので、まぁ予想通り。流石にこの環境で WindowsMe は少々きつくて、大学に上がり若干財力が出てきたこともあり PC の自作を決意。その後、一部パーツを<a href="/Homebuilt-1">世界最速 1 号 Ver.1</a> に吸収され廃棄。</p>\n<h2>当時はまったPCゲーム</h2>\n<ul>\n<li>\n<p>BM98</p>\n</li>\n<li>\n<p>DazzleDazzleRealization</p>\n</li>\n<li>\n<p>AMEL BROAT</p>\n</li>\n<li>\n<p>アンディ君の冒険2・3</p>\n<h2>製作物・他やってたこと</h2>\n</li>\n<li>\n<p>(オリジナルゲーム)<a href="/mk-iik">Mk-IIK</a></p>\n</li>\n<li>\n<p>(オリジナルゲーム)<a href="/choppin">牛チョップ</a></p>\n</li>\n<li>\n<p>(オリジナルゲーム)<a href="/solo2k">PvDDR(後の6 Arrowne 2K)</a></p>\n<h2>性能</h2>\n</li>\n<li>\n<p>CPU: intel Pentium (P54C/100MHz)</p>\n</li>\n<li>\n<p>RAM: 16MB→64MB</p>\n</li>\n<li>\n<p>GPU: S3 Trio64</p>\n</li>\n<li>\n<p>VRAM: 2MB</p>\n</li>\n<li>\n<p>HDD: 4GB(EIDE) + 2GB(SCSI)</p>\n</li>\n<li>\n<p>Drive: 4 倍速 CD-ROM ドライブ ×1 + 3.5inch FDD ×1</p>\n</li>\n<li>\n<p>NET: 10Base-T + 22.8kbps FaxModem</p>\n</li>\n<li>\n<p>SOUND: SB16 互換</p>\n</li>\n<li>\n<p>OS: Windows98 → TurboLinux3 → Windows2000 Professional RC1 → WindowsMe</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"1998-10-12T21:00:00+09:00",strDate:"1998/10/12",title:"(1998-2000) TOSHIBA BREZZA 5100CX"}}},pathContext:{path:"/ja/blog/1998/10/12-brezza5100cx/",langKey:"ja"}}}});
